import { useEffect, useState } from "react"

export const EthereumComponent: React.FC = () => {

    const [ETC, setETC] = useState<any>()

    useEffect(() => {
        const pricesWs = new WebSocket('wss://ws.coincap.io/prices?assets=ethereum')

        pricesWs.onmessage = msg => {
            console.log(typeof JSON.parse(msg.data))
            const value = JSON.parse(msg.data)
            setETC(Object.values(value))
        }
    })

    return(
        <div>
            <p>Ethereum: {ETC}</p>
        </div>
    )
}
